import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function NavBar({ userType, onLogout }) {
  const navigate = useNavigate();

  useEffect(() => {
    if (!sessionStorage.getItem("name")) {
      navigate("/");
    }
  }, []);

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-info">
      <div className="container-fluid">
        <a className="navbar-brand h3 text-light" href="#">
          Medical Store Management
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarText"
          aria-controls="navbarText"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarText">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            {userType === "admin" && (
              <>
                <li className="nav-item">
                  <a className="nav-link" href="/admin/users">Users</a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="/admin/medicine-bookings">View Bookings</a>
                </li>
              </>
            )}
            <li className="nav-item">
              <a className="nav-link" href="/change-password">Change Password</a>
            </li>
          </ul>
          <span className="navbar-text px-3">
            Welcome, {sessionStorage.getItem("name")}
          </span>
          <button onClick={onLogout} className="btn btn-link text-light">
            <i className="bi bi-box-arrow-left"></i> Logout
          </button>
        </div>
      </div>
    </nav>
  );
}
